  return (
    <div className="skarimaa">
      <div className="bar">
        <div className="allURL">
          <a className={"/" === true ? "divtrue" : "divfalse"} href="/">
            דף הבית
          </a>
          <a href="/:סקרים-בתשלום">סקרים בתשלום</a>
          <a href="/שיווק-שותפים">שיווק שותפים</a>
          <a href="/צור-קשר">צור קשר</a>
        </div>
      </div>
      {/* <BlogPost /> */}
    </div>
  );
};

export default Skarimaa;
